const work = () => {
  return (
    <div className="flex flex-col">
      <div className="flex justify-center md:justify-start ">
        <h1 className="text-4xl py-8 text-white font-bold">MY PROJECTS</h1>
      </div>

      <div className='flex flex-col'>
        //image
        <div>
        <img className='rounded-xl' src={Calculator} alt="" />
          </div>
        </div>
        //description
        <div></div>

       </div>

  )
}

export default work
